import HelloWorld from '../components/HelloWorld.vue';
import NavBar from '../components/Navbar.vue';
import Federal from '../components/Federal.vue';
import Ontario from '../components/Ontario.vue';
import Quebec from '../components/Quebec.vue';
import OpinionGraph from '../components/OpinionGraph.vue';

export default {
    name: 'App',
    components: {
        HelloWorld,
        NavBar,
        Federal,
        Ontario,
        Quebec,
        OpinionGraph   
    },
    data() {
        return {
            currentView: "Federal"
        }
    },
    methods: {
        toView(view) {
            this.currentView = view;
        }
    }
}
